import React from 'react'
import './Home.css'
import ProfileSide from '../../Components/ProfileSide/ProfileSide'

const Home = () => {
  return (
    <div className='Home'>
      <ProfileSide/>
      
      <div className="post">Posts</div>
      <div className="rightSide">Right</div>
    </div>
  )
}

export default Home
